import React from 'react';

class Log extends React.Component {
    constructor(props) {
        super(props);
        this.state = { showStackTrace: false };

        this.handleClick = this.handleClick.bind(this);
    }

    handleClick() {
        this.setState(state => ({
            showStackTrace: !state.showStackTrace
        }));
    }

    render() {
        return (
            <div className='log'>
                <table className='logContents'>
                    <tbody>
                        <tr>
                            <td width="5%">{this.props.timeStamp}</td>
                            <td width="5%">
                                <button onClick={this.handleClick}>stack</button>
                            </td>
                            <td width="90%">{this.props.log}</td>
                        </tr>
                    </tbody>
                </table>
                { this.state.showStackTrace && 
                    <div className='stackTrace'>
                        {this.props.stackTrace}
                    </div>
                }
            </div>
        );
    }
}

